import WorksheetHero from '../components/Worksheets/hero';
import { json, redirect, useRouteLoaderData } from 'react-router-dom';

const Worksheet = () => {
    return (
        <>
            <WorksheetHero />
        </>
    );
};

export default Worksheet;

export const eventDetailLoader = async ({ booikId, params }) => {
    const id = '82464444-790a-45dd-b74b-bff9d5cd622d';
    const response = await fetch(
        `https://app.prepanywhere.com/api/stu/static_books/all_chapters?id=${id}
    `
    );

    if (!response.ok) {
        throw json({ message: 'Could not fetch event.' }, { status: 500 });
    } else {
        return response;
    }
};
